<script setup>
  import { gsap } from 'gsap'
  import { MotionPathPlugin } from 'gsap/MotionPathPlugin.js'
  import { onBeforeUnmount, onMounted, ref } from 'vue'

  gsap.registerPlugin(MotionPathPlugin)

  const mainTl = gsap.timeline({ paused: true })

  const init = () => {
    mainTl.set('.ring', {
      transformOrigin: '50% 50%',
      scale: 0,
      opacity: 0,
    })

    mainTl.set('.small-fish', {
      opacity: 0.8,
      x: 0,
      y: 0,
      svgOrigin: '0 0',
      transformOrigin: '50% 0%',
      clearProps: 'transform',
    })

    mainTl.set(['#fish01', '#fish02'], {
      transformOrigin: '50% 0%',
      skewX: 0,
      svgOrigin: '0 0',
      x: 0,
      y: 0,
    })

    mainTl.set(['#tail', '#tail_2'], {
      transformOrigin: '50% 95%',
      skewX: 0,
      rotate: 0,
    })

    mainTl.set(['#finL01', '#finL02'], {
      transformOrigin: '0% 95%',
      skewX: 0,
      rotate: 0,
    })
    mainTl.set(['#finR01', '#finR02'], {
      transformOrigin: '100% 90%',
      skewX: 0,
      rotate: 0,
    })

    const fishMotion = () => {
      // MotionPathPlugin.convertToPath('ellipse')
      let tl = gsap.timeline()

      tl.to('#fish01', {
        motionPath: {
          path: '#path01',

          //   curviness: 2,
          align: '#path01',
          alignOrigin: [0.5, 0.5],
          autoRotate: -90,
          immediateRender: true,
        },
        duration: 40,
        repeat: -1,
        ease: 'sine.out',
        smoothOrigin: true,
      })

      tl.to(
        '#fish02',
        {
          motionPath: {
            path: '#path02',

            align: '#path02',
            alignOrigin: [0.5, 0.5],
            autoRotate: -90,
            immediateRender: true,
          },
          duration: 80,
          repeat: -1,
          ease: 'sine.out',
          smoothOrigin: true,
        },
        '<'
      )

      return tl
    }

    const fishRotation = () => {
      let tl = gsap.timeline()

      tl.fromTo(
        ['#fish01', '#fish02'],
        { skewX: -6 },
        {
          skewX: 8,
          duration: 3,
          repeat: -1,
          yoyo: true,
          ease: 'sine.inOut',
        },
        '<'
      )
      tl.fromTo(
        '#tail',
        {
          rotate: gsap.utils.random(-8, -12),
          skewX: 5,
          skewY: 3,
        },
        {
          rotate: gsap.utils.random(8, 12),
          skewY: -3,
          skewX: -5,
          yoyo: true,
          repeat: -1,
          duration: 1.8,
          ease: 'sine.out',
        },
        '<'
      )
      tl.fromTo(
        '#tail_2',
        {
          rotate: -15,
          skewX: 5,
        },
        {
          rotate: 20,
          skewX: -5,
          yoyo: true,
          repeat: -1,
          duration: 2.1,
          ease: 'sine.out',
        },
        '<'
      )
      tl.fromTo(
        ['#finL02', '#finL01'],
        {
          rotate: -15,
          skewX: 10,
        },
        {
          rotate: 10,
          skewX: -10,
          yoyo: true,
          repeat: -1,
          duration: 3,
          ease: 'sine.out',
        },
        '<'
      )
      tl.fromTo(
        ['#finR01', '#finR02'],
        {
          rotate: -15,
          skewX: 10,
        },
        {
          rotate: 10,
          skewX: -10,
          yoyo: true,
          repeat: -1,
          duration: 2.8,
          ease: 'sine.out',
        },
        '<'
      )

      return tl
    }

    const fishGroup = () => {
      let tl = gsap.timeline({
        repeatDelay: 15,
        repeat: -1,
      })

      tl.to(
        '.small-fish',

        {
          motionPath: {
            path: [
              { x: -100, y: -100 },
              { x: -150, y: -120 },
              { x: -152, y: -240 },
              { x: -250, y: -330 },
              { x: -380, y: -330 },
            ],

            curviness: 0,
            alignOrigin: [0.5, 0.5],
            autoRotate: 120,
            immediateRender: true,
          },
          stagger: 0.1,
          opacity: 0.3,
          duration: 9.5,
          ease: 'expo.in',
          clearProps: true,
        }
      )

      return tl
    }

    const waterDrops01 = () => {
      let tl = gsap.timeline()
      tl.fromTo(
        ['#ring01', '#ring02', '#ring03'],
        {
          opacity: 1,
        },
        {
          stagger: 0.5,
          scale: 1,
          opacity: 0,
          duration: 4,
          repeat: -1,
          repeatDelay: 10,
          ease: 'circ.out',
        }
      )
      tl.fromTo(
        ['#ring01-2', '#ring02-2', '#ring03-2'],
        {
          opacity: 1,
        },
        {
          stagger: 0.6,
          scale: 1,
          opacity: 0,
          duration: 4,
          repeat: -1,
          repeatDelay: 10,
        }
      )
      tl.fromTo(
        ['#ring01-3', '#ring02-3', '#ring03-3'],
        {
          opacity: 1,
        },
        {
          stagger: 0.5,
          scale: 1,
          opacity: 0,
          duration: 4,
          repeat: -1,
          repeatDelay: 10,
        }
      )

      return tl
    }

    mainTl.add(fishMotion)
    mainTl.add(fishRotation)
    mainTl.add(fishGroup)
    mainTl.add(waterDrops01)
  }

  onMounted(() => {
    init()
    mainTl.play()
  })
  onBeforeUnmount(() => {
    mainTl.revert()
  })
</script>
